import './App.css';
import axios from "axios";
import { useEffect, useState } from "react";

function App() {
  const [listOfVrstaOdjece, setListOfVrstaOdjece] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:3100/vrsta_odjece").then((response) => {
      setListOfVrstaOdjece(response.data);
    });
  }, [])

  return (
    <div className="App">
      {listOfVrstaOdjece.map((value, key) => {
        return (
          <div className="post">
            <div className="title">{value.vrstaOdjeceID}</div>
            <div className="body"> <img alt="Qries" src={value.ikonica} width="150" height="150"></img> </div>
            <div className="footer">{value.nazivVrste}</div>
          </div>
        );
      })}
    </div>
  );
}

export default App;
